  true,\n\t\"url\": null,\n\t\"notes\": \"The Common Core of Data, 2001-02 (CCD 2001-02),
  is a study that is part of the Common Core of Data (CCD) program; program data is
  available since 1986-1987 at <http://nces.ed.gov/ccd/ccddata.asp>. CCD 2001-02 (http://nces.ed.gov/ccd/index.asp)
  is a cross-sectional survey that collected fiscal and non-fiscal data about all
  public schools, public school districts, and state education agencies in the 50
  United States, the District of Columbia, Department of Defense schools, and other
  outlying jurisdictions. The data were supplied by state education agency officials
  and included basic information and descriptive statistics on public elementary and
  secondary schools and schooling in general. Key information produced from CCD 2001-02
  include information that described schools and school districts, including name,
  address, and phone number; student counts by race/ethnicity, grade and sex and full-time
  equivalent (FTE) staff counts by labor category; and fiscal data, including revenues
  and expenditures.\",\n\t\"owner_org\": \"8c0bc869-1189-4ced-af26-2abd2337b886\",\n\t\"extras\":
